const App = () =>{
  const [inputList , finalInput] = useState("");
  const [submit , newSubmit] = useState()

  const items = (event) => {
      finalInput(event.target.value)
  }
  const submitBtn = (event) =>{
    newSubmit( (getValue) =>{
      return[...getValue , inputList]
    })

  }
  return(
    <>
    <div className="container">
      <div className="center-div">
        <br />
        <h1>ToDo List</h1>
        <br />
        <input type = "text" placeholder="Add Items" onChange={items}/>
        <button onClick={submitBtn}> + </button>


        <ol>


          {
            submit.map( (value)=>{
               return <li>{value}</li>
            })
          }
        </ol>
      </div>
    </div>

    </>
  );
}
  export default App;
